import Chat from './components/Chat'
import Join from './components/Join'
import {BrowserRouter as Router , Route , Routes} from 'react-router-dom'
import './App.css';

function App() {
  return (
   <>
   <Router>
    <Routes>
    <Route exact path="/" component={Join}/>
    <Route path='/chat' component={Chat}/>
    </Routes>
   </Router>
   </>
  );
}

export default App;
